import React from 'react';

const ManageCard = () => {
    return (
        <div class="extra content">
      <div class="ui two buttons">
        <div class="ui basic green button">View</div>
        <div class="ui basic red button">Delete</div>
      </div>
    </div>

    );
};

export default ManageCard;
